<html lang=en>

<head>
    <meta charset=UTF-8>
    <meta content="width=device-width,initial-scale=1" name=viewport>
    <title>Timothy Martens â€” Healthcare Experience Design & Strategy</title>
    <style>
        :where(html) {
            color-scheme: dark light;
            --dark: var(--color-dark, black);
            --foreground-1-d: var(--color-foregroundPrimaryDark, hsl(0 0% 70%));
            --foreground-2-d: var(--color-foregroundSecondaryDark, hsl(0 0% 94%));
            --background-1-d: var(--color-backgroundPrimaryDark, hsl(0, 0%, 4%));
            --background-2-d: var(--color-backgroundSecondaryDark, hsl(0 0% 37%));
            --background-3-d: var(--color-backgroundTertiaryDark, hsl(0 0% 20%));
            --light: var(--color-light, white);
            --foreground-1-l: var(--color-foregroundPrimaryLight, hsl(0 0% 30%));
            --foreground-2-l: var(--color-foregroundSecondaryLight, hsl(0 0% 6%));
            --background-1-l: var(--color-backgroundPrimaryLight, hsl(0 0% 96%));
            --background-2-l: var(--color-backgroundSecondaryLight, hsl(0 0% 63%));
            --background-3-l: var(--color-backgroundTertiaryLight, hsl(0 0% 80%));
            --dark-light: light-dark(var(--light), var(--dark));
            --next-1: light-dark(var(--foreground-1-l), var(--foreground-1-d));
            --next-2: light-dark(var(--foreground-2-l), var(--foreground-2-d));
            --canvas-1: light-dark(var(--background-1-l), var(--background-1-d));
            --canvas-2: light-dark(var(--background-2-l), var(--background-2-d));
            --canvas-3: light-dark(var(--background-3-l), var(--background-3-d));
            --stroke: 1px
        }

        :where(*, ::after, ::before) {
            box-sizing: border-box;
            font-family: system-ui, sans-serif;
            font-size: 1rem;
            font-style: normal;
            font-weight: 400;
            line-height: 1.5;
            margin: 0;
            padding: 0
        }

        body,
        html {
            background-color: var(--dark-light);
            color: var(--next-1)
        }

        @keyframes fade-in-focus {
            from {
                filter: blur(3px);
                opacity: 0
            }

            to {
                filter: blur(0);
                opacity: 1
            }
        }

        body {
            animation: fade-in-focus cubic-bezier(.39, .575, .565, 1) .6s;
            background: radial-gradient(rgba(102, 102, 102, .5) 20%, rgba(0, 0, 0, 0) 20%) repeat scroll 0 0/4px 4px padding-box;
            display: grid;
            overflow: hidden;
            place-content: center;
            height: 100dvh;
            width: 100dvw;
            position: relative
        }

        main {
            background-color: var(--canvas-1);
            border: 1px solid var(--canvas-3);
            border-radius: .5rem;
            padding: .75rem 1.125rem;
            z-index: 1
        }

        h1 {
            color: var(--next-2);
            font-weight: 700
        }

        a {
            color: var(--next-1)
        }

        .axis {
            background-color: var(--canvas-3);
            background-position: center;
            position: absolute;
            z-index: -1
        }

        .x.axis {
            background-size: 100% var(--stroke);
            height: var(--stroke);
            width: calc(100% - 2 * var(--stroke));
            top: calc(50% - var(--stroke) / 2);
            left: var(--stroke)
        }

        .y.axis {
            background-size: var(--stroke) 100%;
            height: calc(100% - 2 * var(--stroke));
            width: var(--stroke);
            top: var(--stroke);
            left: calc(50% - var(--stroke)/ 2)
        }

        .axis::after,
        .axis::before {
            --size: 20px;
            --axis-offset: calc(-1 * var(--size) / 2 - var(--stroke) / 2);
            --edge-offset: calc((sqrt(2) * var(--size)) / 2 - var(--size) / 2 - var(--stroke));
            content: "";
            position: absolute;
            height: var(--size);
            width: var(--size);
            border: var(--stroke) solid var(--canvas-3);
            clip-path: polygon(0 0, 100% 100%, 0 100%)
        }

        .x.axis::before {
            left: var(--edge-offset);
            top: var(--axis-offset);
            rotate: 45deg
        }

        .x.axis::after {
            right: var(--edge-offset);
            top: var(--axis-offset);
            rotate: -135deg
        }

        .y.axis::before {
            top: var(--edge-offset);
            left: var(--axis-offset);
            rotate: 135deg
        }

        .y.axis::after {
            bottom: var(--edge-offset);
            left: var(--axis-offset);
            rotate: -45deg
        }

        .amp {
            font-size: .775em;
            font-weight: 500
        }

        orga-nism {
            position: fixed;
            inset: 0;
            width: fit-content;
            height: fit-content;
            margin: auto
        }

        @keyframes organism {
            100% {
                transform: translate3d(var(--x-2), var(--y-2), 0);
                opacity: 1
            }
        }

        orga-nism q {
            color: oklch(80% .015 calc(sin(var(--hue-angle, 10) * var(--i)) * var(--hue-bend, 40) + var(--hue-base, 200)));
            background: currentColor;
            border-radius: 50%;
            opacity: 0;
            position: absolute;
            quotes: none;
            --size: 3;
            height: calc(var(--size) * .1vmin);
            width: calc(var(--size) * .1vmin);
            --canvas: 80;
            --rotation: 360deg;
            --angle-1: (4 * var(--i));
            --angle-2: calc(var(--i) * var(--rotation) / var(--n));
            --x-1: calc(sin(var(--angle-1)) * var(--canvas) * 1vmin);
            --y-1: calc(cos(var(--angle-1)) * var(--canvas) * 1vmin);
            --x-2: calc(tan(var(--angle-2)) * var(--canvas) * 1vmin);
            --y-2: calc(sin(var(--angle-2)) * var(--canvas) * 1vmin);
            --duration: 7s;
            --delay: calc(var(--i) * var(--duration) / var(--n) * 4);
            animation: organism var(--duration) ease-in-out var(--delay) infinite alternate;
            transform: translate3d(var(--x-1), var(--y-1), 0)
        }

        @media (prefers-reduced-motion: reduce) {

            *,
            ::after,
            ::before {
                animation-duration: 0s !important;
                animation-iteration-count: 1 !important;
                transition-duration: 0s !important;
                scroll-behavior: auto !important
            }
        }
    </style>
</head>
